/* MaterialDesignIcons.com */
@font-face {
  font-family: "Material Design Icons";
  src: url("../fonts/materialdesignicons-webfont.eot?v=7.3.67");
  src: url("../fonts/materialdesignicons-webfont.eot?#iefix&v=7.3.67") format("embedded-opentype"), url("../fonts/materialdesignicons-webfont.woff2?v=7.3.67") format("woff2"), url("../fonts/materialdesignicons-webfont.woff?v=7.3.67") format("woff"), url("../fonts/materialdesignicons-webfont.ttf?v=7.3.67") format("truetype");
  font-weight: normal;
  font-style: normal;
}

.mdi:before,
.mdi-set {
  display: inline-block;
  font: normal normal normal 24px/1 "Material Design Icons";
  font-size: inherit;
